    var request: HAKit.HARequest

    static func currentUser() -> HAKit.HATypedRequest<HAKit.HAResponseCurrentUser>

    static func callService(domain domain: HAKit.HAServicesDomain, service service: HAKit.HAServicesService, data data: [String : Any] = [:]) -> HAKit.HATypedRequest<HAKit.HAResponseVoid>

    static func getServices() -> HAKit.HATypedRequest<HAKit.HAResponseServices>

    static func sendSttData(sttHandlerId sttHandlerId: UInt8, audioDataBase64Encoded audioDataBase64Encoded: String) -> HAKit.HATypedRequest<HAKit.HAResponseVoid>
}

struct HATypedSubscription<ResponseType> where ResponseType : HAKit.HADataDecodable {

    init(request request: HAKit.HARequest)

    var request: HAKit.HARequest

    static func events(_ type: HAKit.HAEventType) -> HAKit.HATypedSubscription<HAKit.HAResponseEvent>

    static func renderTemplate(_ template: String, variables variables: [String : Any] = [:], timeout timeout: Measurement<UnitDuration>? = nil) -> HAKit.HATypedSubscription<HAKit.HAResponseRenderTemplate>

    static func stateChanged() -> HAKit.HATypedSubscription<HAKit.HAResponseEventStateChanged>

    static func subscribeEntities() -> HAKit.HATypedSubscription<HAKit.HACompressedStatesUpdates>
}

extension Array : HAKit.HADataDecodable where Element : HAKit.HADataDecodable {

    init(data data: HAKit.HAData) throws
}

extension Optional : HAKit.HADecodeTransformable where Wrapped : HAKit.HADecodeTransformable {

    static func decode(unknown value: Any) throws -> Wrapped??
}

extension Array : HAKit.HADecodeTransformable where Element : HAKit.HADecodeTransformable {

    static func decode(unknown value: Any) throws -> [Element]?
}

extension Dictionary : HAKit.HADecodeTransformable where Key == String, Value : HAKit.HADecodeTransformable {

    static func decode(unknown value: Any) throws -> [Key : Value]?
}

extension Date : HAKit.HADecodeTransformable {

    static func decode(unknown value: Any) -> Date?
}
